#[allow(missing_docs)]
#[repr(C)]
pub struct VestingContract { /// The eventual token receiver pub owner: Pubkey, /// The contract escrow vault pub vault: Pubkey, /// Index in the current schedule vector of the last completed schedule pub current_schedule_index: u64, /// Used to generate the signing PDA which owns the vault pub signer_nonce: u8, /// Describes the token release schedule pub schedule: Vec<VestingSchedule>,
} #[derive(Clone, Copy, Zeroable, Pod)]
#[repr(C)]
pub struct VestingSchedule { pub unlock_timestamp: u64, pub quantity: u64,
} However, the above still does not compile. To sum up, the core bytemuck trait we are interested in is the Pod trait. This trait requires the Zeroable and Copy traits. However, a Vec does not implement the Copy trait. In general, this is due to the fact that Vec is a pointer which owns a section of heap memory. Copying it would mean allocating a new section of heap memory, whereas the Copy trait is reserved for variables which exist on the stack. In fact it is impossible to directly cast Vec objects. To work around this limitation, we split our object into a reference to a header and a reference to a slice of VestingSchedule objects. This means that the VestingContract object will hold cast references to the underlying objects, instead of being a direct cast by itself. This layer of indirection is of no consequence in terms of performance, and allows us a lot more flexibility in terms of the kind of data structures we can type cast.

