pub struct Accounts<'a, T> { /// SPL token program account pub spl_token_program: &'a T, /// The account which will store the [`VestingContract`] data structure #[cons(writable)] pub vesting_contract: &'a T, /// The contract's escrow vault #[cons(writable)] pub vault: &'a T, #[cons(writable)] /// The account currently holding the tokens to be vested pub source_tokens: &'a T, #[cons(signer)] /// The owner of the account currently holding the tokens to be vested pub source_tokens_owner: &'a T, /// The eventual recipient of the vested tokens pub recipient: &'a T,
} The first thing to notice is that the Accounts struct is generic over what we actually mean by what an account is. The reason why it is generic is to enable the same struct to be used with references to Pubkey objects when writing bindings, or AccountInfo objects when writing the instruction's logic. The InstructionsAccount trait is useful to auto-generate Rust instruction bindings, which we'll make use of later. This trait's automatic derivation may need annotations. This is where the #[cons(signer)] and #[cons(writable)] field attributes come in. In general, struct fields with the InstructionsAccount auto-derived trait can take a #[cons(...)] attribute. cons stands for constraint : we can require the account to be writable, to be a signer, or both. This gives the valid attributes #[cons(signer)], #[cons(writable)], #[cons(signer, writable)] and #[cons(writable, signer)]. We then need to implement a method to parse the &[AccountInfo] slice into our Accounts struct. We will also use this method to perform rudimentary but essential security checks. You should understand the reason behind each check in order to familiarize yourself with basic security base practices when developing for Solana. impl<'a, 'b: 'a> Accounts<'a, AccountInfo<'b>> { pub fn parse( accounts: &'a [AccountInfo<'b>], program_id: &Pubkey, ) -> Result<Self, ProgramError> { let accounts_iter = &mut accounts.iter(); let accounts = Accounts { spl_token_program: next_account_info(accounts_iter)?, vesting_contract: next_account_info(accounts_iter)?, vault: next_account_info(accounts_iter)?, source_tokens: next_account_info(accounts_iter)?, source_tokens_owner: next_account_info(accounts_iter)?, recipient: next_account_info(accounts_iter)?, }; // Check keys check_account_key(accounts.spl_token_program, &spl_token::ID)?; // Check owners check_account_owner(accounts.vesting_contract, program_id)?; check_account_owner(accounts.vault, &spl_token::ID)?; check_account_owner(accounts.source_tokens, &spl_token: