PDAs are Solana's solution for a recurring generic problem in program design : how can our program own anything of value? Conventionally, owning an asset on a blockchain means controlling a private key the public key of which is set as its owner . Then, users can sign transactions to authorize operations on assets they own. They key to all of this is that the private key is only known to its owner. Sometimes, we need a program to own something in the same way that a user does. However, any information a program has access to is available to anyone, so we can't really give a private key to our program. What we need is a public key which isn't tied to a private key, but instead to a particular program. This is precisely what PDAs are. A PDA is uniquely derived from an array of seeds . To generate a PDA, we can use one of two methods Pubkey::find_program_address, or Pubkey::create_program_address. The difference between the two is that create_program_address needs valid seeds which generate a valid PDA. A valid PDA is a Pubkey which we're sure doesn't have a private key. It lies outside the ed25519 curve used by Solana. find_program_address will take a seed array and find a u8 to add to the seed array such that the resulting array is a valid PDA seed. We call this u8 the signer_nonce. We can relate the two methods: let seeds: &[u8] = &[...];
let (k, nonce) = Pubkey::find_program_address(&[seeds], program_id).unwrap();
let k2 = Pubkey::create_program_ddress(&[seeds, &[signer_nonce]]).unwrap();
// k and k2 will be the same
assert_eq!(k, k2); In general, find_program_address can be relatively inefficient: it loops over potential nonces until it finds a valid one. The real issue is that the length of this loop is quite unpredictable. In most cases, it will be very short. This means that the entirety of your testing scenarios can only test for short loops, and edge cases can show up in production later down the line. Therefore, as a general rule of thumb, find_program_address should be avoided on-chain because it consumes an unreliable amount of compute budget. There are exceptions to this rule, especially when PDAs are used as a mapping function. This is why we ask the user to provide a signer_nonce: find_program_address is executed off-chain. A PDA's seeds serve a similar purpose to a private key. When a program needs to sign for a PDA, it uses the PDA's seeds in a call to invoke_signed. The runtime can then make sure that the PDA to sign for corresponds to those seeds and the calling program. To add a layer of security, we want our vesting contract instances to be as compartmentalized as possible. Therefore, we will use the VestingContract key as seeds. Each instance already has its own vault, and this allows each contract to have its own separate signing authority. The altenative to this is related to the idea of central state , which can be required by some use cases and is supported by bonfida-utils.

